  `Autor_nombre` varchar(100) NOT NULL,
  PRIMARY KEY (`Autores_id`)
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_spanish2_ci;

